import React from 'react'
import PropTypes from 'prop-types'


export default function Scoreboard(players) {
	return (
		<table className="c-score-table">
			{
				players.map((player) => (
					<PlayeRow 
					id = {player.id}
					name = {player.name}
					score = {player.score}
					active = {player.active}
					/>
					))
			}
		</table>
		)
}
